import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./Login";
import Menu from "./components/Menu"

const Routers = () => {
  return (
    <>
      <BrowserRouter>
        <Routes>


          <Route path="/" element={<Login />} />
          <Route path="/menu" element={<Menu />} />

        </Routes>
      </BrowserRouter>
    </>
  );
};
export default Routers;
